document.addEventListener('DOMContentLoaded', () => {
	const main = document.querySelector('.container')
	const container = document.createElement('div')
	const containerChat = document.createElement('div')
	const containerInput = document.createElement('div')
	const input = document.createElement('input')
	const inputIcon = document.createElement('div')
	const close = document.createElement('button')
	const iconOpenChatContainer = document.createElement('div')
	const iconOpenChat = document.createElement('button')

	close.addEventListener('click', () => {
		container.classList.add('display-none')
	})

	iconOpenChat.addEventListener('click', () => {
		container.classList.remove('display-none')
	})

	function Сhel(nameProp, meflag) {
		const chelContainer = document.createElement('div')

		const messageContainer = document.createElement('div')
		const messageText = document.createElement('div')
		const name = document.createElement('div')
		
		const iconContainer = document.createElement('div')
		const icon = document.createElement('img')
		const iconSpan = document.createElement('div')

		chelContainer.classList.add('chel-container')
		
		messageContainer.classList.add('chel-container__message-container')
		messageText.classList.add('chel-container__message-text')
		name.classList.add('chel-container__message-name')
		
		iconContainer.classList.add('chel-container__icon-container')
		icon.classList.add('chel-container__icon-icon')
		iconSpan.classList.add('chel-container__icon-span')

		messageContainer.append(messageText, name)

		if(meflag === 'me') {
			messageText.innerHTML = `Всем привет!`

			messageContainer.classList.add('chel-container__message-container-me')
			iconContainer.classList.add('chel-container__icon-container-me')
			icon.classList.add('chel-container__icon-icon-me')
			iconSpan.classList.add('chel-container__icon-span-me')

			icon.src = '../img/Ellipse52.png'

			chelContainer.append(iconContainer, messageContainer)
		} else if(meflag === 'admin') {
			messageText.innerHTML = `Мы подобрали спец. предложение для поездки втроем на Байкал! Ниже будет ссылочка для покупки билетов! Ждем Вас!`
			
			const wrapperSale = document.createElement('div')
			const btn = document.createElement('button')

			btn.innerHTML = 'Рассмотреть предложение'

			wrapperSale.classList.add('chel-container__message-container-admin-wrapper-btn')
			btn.classList.add('chel-container__message-container-admin-btn')
			messageText.classList.add('chel-container__message-text-admin')

			wrapperSale.append(btn)

			name.innerHTML = 'Admin'

			messageContainer.classList.add('chel-container__message-container-admin')
			iconContainer.classList.add('chel-container__icon-container-admin')
			icon.classList.add('chel-container__icon-icon-admin')
			iconSpan.classList.add('chel-container__icon-span-admin')

			messageContainer.append(wrapperSale)
			chelContainer.append(messageContainer)
		} else {
			icon.src = '../img/Ellipse51.png'
			messageText.innerHTML = `Всем привет! Заинтересовался поездкой на Байкал, ищу компанию для веселой поездки`
			name.innerHTML = nameProp
	
			chelContainer.append(messageContainer, iconContainer)
		}

		iconContainer.append(icon, iconSpan)

		return chelContainer
	}

	// const me = Chel('d', true);

	for(let i = 0; i < 5; i++) {
		if(i === 0) {
			const chel = Сhel('Антон', '');

			containerChat.append(chel)
		} else if(i === 1) {
			const chel = Сhel('Антон', 'me');

			containerChat.append(chel)
		} else {
			const chel = Сhel('Антон', 'admin');

			containerChat.append(chel)
		}
	}

	container.classList.add('chatUsers-container')
	containerChat.classList.add('chatUsers-container-chat-container')
	containerInput.classList.add('chatUsers-container-input-container')
	input.classList.add('chatUsers-container-input')
	inputIcon.classList.add('chatUsers-container-input-icon')
	close.classList.add('chatUsers-close')
	iconOpenChatContainer.classList.add('chatUsers-open-container')
	iconOpenChat.classList.add('chatUsers-open')

	close.innerHTML = `
		<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
		<path d="M18 6L6 18M6 6L18 18" stroke="#747474" stroke-width="2" stroke-linecap="square" stroke-linejoin="round"/>
		</svg>	
	`

	iconOpenChat.innerHTML = 'Открыть'

	input.placeholder = 'Введите сообщение...'

	inputIcon.innerHTML = `
		<svg width="40" height="30" viewBox="0 0 68 58" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
		<rect width="68" height="58" fill="url(#pattern0)"/>
		<defs>
		<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
		<use xlink:href="#image0_109_408" transform="matrix(0.000244141 0 0 0.000286234 0 -0.0862069)"/>
		</pattern>
		<image id="image0_109_408" width="4096" height="4096" xlink:href="data:image/jpeg;base64,"/>
		</defs>
		</svg>	
	`

	iconOpenChatContainer.append(iconOpenChat)
	containerInput.append(input, inputIcon)
	container.append(containerChat, containerInput, close)
	main.append(container, iconOpenChatContainer)
	return container
})
